void myproject::thread_ap_clk_no_reset_() {
    if ((esl_seteq<1,1,1>(ap_const_logic_0, Block_arrayctor_loop_U0_ap_ready.read()) && 
         esl_seteq<1,1,1>(ap_const_logic_1, ap_sync_ready.read()))) {
        Block_arrayctor_loop_U0_ap_ready_count = (!Block_arrayctor_loop_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(Block_arrayctor_loop_U0_ap_ready_count.read()) - sc_biguint<2>(ap_const_lv2_1));
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, Block_arrayctor_loop_U0_ap_ready.read()) && 
                esl_seteq<1,1,1>(ap_const_logic_0, ap_sync_ready.read()))) {
        Block_arrayctor_loop_U0_ap_ready_count = (!Block_arrayctor_loop_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(Block_arrayctor_loop_U0_ap_ready_count.read()) + sc_biguint<2>(ap_const_lv2_1));
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_Block_arrayctor_loop_U0_ap_ready = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (ap_start.read() & 
             ap_sync_ready.read()))) {
            ap_sync_reg_Block_arrayctor_loop_U0_ap_ready = ap_const_logic_0;
        } else {
            ap_sync_reg_Block_arrayctor_loop_U0_ap_ready = ap_sync_Block_arrayctor_loop_U0_ap_ready.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_conv_2d_large_cl_1_U0_ap_ready = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (ap_start.read() & 
             ap_sync_ready.read()))) {
            ap_sync_reg_conv_2d_large_cl_1_U0_ap_ready = ap_const_logic_0;
        } else {
            ap_sync_reg_conv_2d_large_cl_1_U0_ap_ready = ap_sync_conv_2d_large_cl_1_U0_ap_ready.read();
        }
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_sync_ready.read()) && 
         esl_seteq<1,1,1>(ap_const_logic_0, conv_2d_large_cl_1_U0_ap_ready.read()))) {
        conv_2d_large_cl_1_U0_ap_ready_count = (!conv_2d_large_cl_1_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(conv_2d_large_cl_1_U0_ap_ready_count.read()) - sc_biguint<2>(ap_const_lv2_1));
    } else if ((esl_seteq<1,1,1>(ap_const_logic_0, ap_sync_ready.read()) && 
                esl_seteq<1,1,1>(ap_const_logic_1, conv_2d_large_cl_1_U0_ap_ready.read()))) {
        conv_2d_large_cl_1_U0_ap_ready_count = (!conv_2d_large_cl_1_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(conv_2d_large_cl_1_U0_ap_ready_count.read()) + sc_biguint<2>(ap_const_lv2_1));
    }
}

